import Link from 'next/link';

const linkStyle = {
  marginRight: 15,
};

const Header: React.FunctionComponent = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <style jsx>
      {`
        a {
          margin-right: 15;
        }
      `}
    </style>
  </div>
);

export default Header;
